// src/assets/images.js
const images = [
  {
    id: 1,
    url: './img5.jpg',
    tags: ['nature', 'sunset'],
    ingredients: ['trees', 'sky']
  },
  {
    id: 2,
    url: 'img6.jpg',
    tags: ['food'],
    ingredients: ['tomato', 'cheese'] },

  {
    id: 3,
    url: 'img7.jpg',
    tags: ['nature', 'sunset'],
    ingredients: ['trees', 'sky']
  },
  {
    id: 4,
    url: 'img8.jpg',
    tags: ['food'],
    ingredients: ['tomato', 'cheese'] },
    {
      id: 1,
      url: 'img5.jpg',
      tags: ['nature', 'sunset'],
      ingredients: ['trees', 'sky']
    },
    {
      id: 2,
      url: 'img6.jpg',
      tags: ['food'],
      ingredients: ['tomato', 'cheese'] },
  
    {
      id: 3,
      url: require("./img5.jpg"),
      tags: ['nature', 'sunset'],
      ingredients: ['trees', 'sky']
    },
    {
      id: 4,
      url: require("./img5.jpg"),
      tags: ['food'],
      ingredients: ['tomato', 'cheese'] }
    
  ];
  
  export default images;
